import React, { useState } from "react";
import "./index2.css";

const Incredecre = () => {
  const [item, setitem] = useState(0);
  const incre=()=>{
      setitem(item+1);
  }
  const decre=()=>{
      setitem(item-1);
  }
  return (
    <>
      <div className="container">
        <div id="card">
          <h1>O</h1>
          <button onClick={incre}>Incre</button>
          <button onClick={decre}>Decre</button>
        </div>
      </div>
    </>
  );
};

export default Incredecre;
